    render() {
        console.log(PROJECTS);
        return (
            <div className="projects-component">
                <Paper>
                    <Grid container spacing={3}>
                        {PROJECTS.map(project => {
                            return (
                                <Grid item>
                                    <Card>

                                    </Card>
                                </Grid>
                            )
                        })}
                    </Grid>
                </Paper>
            </div>
        )
    }
}

export default Projects
